import React, {Component} from 'react';
import {Redirect} from 'react-router-dom';
import Jumbotron from 'react-bootstrap/Jumbotron';
import {Link} from 'react-router-dom';
import MenuComponent from '../General/MenuComponent';
import FooterComponent from '../General/FooterComponent';
import {RENDER_URL} from '../../Utils/Urls';

const FamilyAreaComponent = () => {

    return (
        <div>
            <MenuComponent/>
            <Jumbotron>
                <p>
                    <span>
                          <Link to={RENDER_URL.ADD_FAMILY_URL} className="btn btn-secondary" variant="secondary">Add Family</Link>
                        <br/>
                    </span>
                    <span>
                        <br/>
                           <Link to={RENDER_URL.FAMILY_LIST_URL} className="btn btn-secondary"  variant="secondary">List Families</Link>
                    </span>
                </p>
                <p>
                </p>
            </Jumbotron>
            <FooterComponent/>

        </div>
    )
};

export default FamilyAreaComponent;
